    @Override
    public void run(String... args) throws Exception {
        log.info("Start SexyImageDataImportRunner 服务启动执行，执行Image数据导入");

        saveWords(hanzi_level1, HanziLevel.ONE, 1);
        saveWords(hanzi_level2, HanziLevel.TWO, 3501);
        saveWords(hanzi_level3, HanziLevel.THREE, 6501);

        log.info("End   SexyImageDataImportRunner 服务启动执行，执行Image数据导入");
    }

    private void saveWords(String hanziText, HanziLevel level, int startIdx) {
        String[] words = hanziText.split("\\)");
        for (int i = 0; i < words.length; i++) {
            String[] wps = words[i].split("\\(");
            Preconditions.checkNotNull(wps[0]);
            Preconditions.checkNotNull(wps[1]);
            Word word = wordRepository.findOne(wps[0]);
            int newIdx = i + startIdx;
            if (word == null) {
                saveNewWord(level, wps[0], wps[1], wps[1], StringEscapeUtils.unescapeJava("\\u31C0\\u31C0"), newIdx);
                try {
                    //Ensure every word's lastUpdated different
                    Thread.sleep(1);
                } catch (InterruptedException e) {
                    e.printStackTrace();
                }
            } else {
                updateWord(word, level, wps[1], wps[1],  StringEscapeUtils.unescapeJava("\\u31C0\\u31C0"),newIdx);
            }
        }
        log.info(String.format("done save %d words", words.length));
    }

    private void updateWord(Word word, HanziLevel level, String pinyin1, String pinyin2, String strokes, int newIdx) {
        if (level.compareTo(word.getLevel()) != 0
                || newIdx != word.getIdx()
                || pinyin1.compareTo(word.getPinyin1()) != 0
                || pinyin2.compareTo(word.getPinyin2()) != 0
                || strokes.compareTo(word.getStrokes()) != 0
                ) {
            System.out.println(String.format("upd %04d,%s,%s,%s,%s", newIdx, word.getWord(), pinyin1, pinyin2, strokes));
            word.setLastUpdated(System.currentTimeMillis());
            word.setLevel(level);
            word.setIdx(newIdx);
            word.setPinyin1(pinyin1);
            word.setPinyin2(pinyin2);
            word.setStrokes(strokes);
            wordRepository.save(word.getWord(), word);
        }
    }

    private void saveNewWord(HanziLevel level, String wordValue, String pinyin1, String pinyin2, String strokes, int newIdx) {
        Word word;
        System.out.println(String.format("new %04d,%s,%s,%s,%s", newIdx, wordValue, pinyin1, pinyin2, strokes));
        word = Word.builder()
                .setWord(wordValue)
                .setIdx(newIdx)
                .setPinyin1(pinyin1)
                .setPinyin2(pinyin2)
                .setStrokes(strokes)
                .setLevel(level)
                .setCreated(System.currentTimeMillis())
                .setLastUpdated(System.currentTimeMillis())
                .setVisitCount(0)
                .build();
        wordRepository.save(word.getWord(), word);
    }
